m/uploads/campaign-templates/3/images/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n					<tr style="line-height: 0px; font-size: 0px;" align="center">\n						<td width="10"><img src="http://be3c.catalyz-emailing.com/uploads/campaign-templates/3/images/sep.gif" width="10" height="1" alt="" border="0" /></td>\n						<td width="175">\n							<img src="http://be3c.catalyz-emailing.com/uploads/campaign-templates/3/images/right_sep.gif" width="175" height="28" alt="" border="0" />\n						</td>\n						<td width="9"><img src="http://be3c.catalyz-emailing.com/uploads/campaign-templates/3/images/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n					<tr align="center">\n						<td style="line-height: 0px; font-size: 0px;" width="10"><img src="http://be3c.catalyz-emailing.com/uploads/campaign-templates/3/images/sep.gif" width="10" height="1" alt="" border="0" /></td>\n						<td width="175">\n							<font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 18px; font-size: 14px;" size="2" color="#666666">Remplissez le bordereau d’inscription PDF et envoyez-le nom par fax au<br/>\n							</font>\n							<font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 22px; font-size: 18px;" size="2" color="#669933">05 63 23 21 01<br/>\n							</font>\n						</td>\n						<td style="line-height: 0px; font-size: 0px;" width="9"><img src="http://be3c.catalyz-emailing.com/uploads/campaign-templates/3/images/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n					<tr align="center" style="line-height: 0px; font-size: 0px;">\n						<td width="10"><img src="http://be3c.catalyz-emailing.com/uploads/campaign-templates/3/images/sep.gif" width="10" height="1" alt="" border="0" /></td>\n						<td width="175">\n							<img src="http://be3c.catalyz-emailing.com/uploads/campaign-templates/3/images/img_02.jpg" width="175" height="255" alt="" border="0" />\n						</td>\n						<td width="9"><img src="http://be3c.catalyz-emailing.com/uploads/campaign-templates/3/images/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n				</table>\n			</td>\n			<!-- /bloc de droite -->\n		</tr>\n	</table>\n\n	<table width="599" bgcolor="#FFFFFF" align="center" cellspacing="0" cellpadding="0" border="0">\n		<tr style="line-height: 0px; font-size: 0px;">\n			<td><img src="http://be3c.catalyz-emailing.com/uploads/campaign-templates/3/images/sep.gif" width="1" height="25" alt="" border="0" /></td>\n		</tr>\n		<tr valign="top">\n			<td align="center">\n				<font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 12px; font-size: 10px;" size="2" color="#669933">Conformément à la loi Informatique et Libertés du 06/01/1978, vous disposez d''un droit d''accès, de rectification<br />et d''opposition aux informations vous concernant qui peut s''exercer par e-mail à <a style="color:#669933;" href="mailto:be3c@be3c.com" target="_blank">be3c@be3c.com</a><br />ou en cliquant sur ce <a style="color:#669933;" href="#UNSUBSCRIBE#" target="_blank">lien de désinscription</a><br />\n				</font>\n			</td>\n		</tr>\n	</table>\n</body>\n</html>', NULL, NULL, 1, 'BE3C', 'be3c@catalyz-emailing.com', NULL, 0, 0, NULL, NULL, 'be3c@catalyz-emailing.com', 'be3c@catalyz-emailing.com', 'server1.waterproof.fr', 'be3c@catalyz-emailing.com', 'be3c', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2012-10-04 10:16:28', 1, '2012-10-04 15:23:49');
