, sans-serif" style="line-height: 12px; font-size: 10px;" size="2" color="#669933">Conform&#233;ment &#224; la loi Informatique et Libert&#233;s du 06/01/1978, vous disposez d''un droit d''acc&#232;s, de rectification et d''opposition aux informations vous concernant qui peut s''exercer par e-mail &#224; <a style="color:#669933;" href="mailto:be3c@be3c.com" target="_blank">be3c@be3c.com</a> ou en cliquant sur ce <a style="color:#669933;" href="#UNSUBSCRIBE#" target="_blank">lien de d&#233;sinscription</a><br />\n				</font>\n			</td>\n		</tr>\n	</table>\n</body>\n</html>', NULL, '\n ** Invitation points techniques ** \nBe3c vous invite à ses nouveaux Points Techniques. Vous retrouverez\nl''ensemble des prochaines réunions d''informations ci-dessous.\n\n * Dernières nouveautés RT 2012\nCe point technique nous permettra de répondre à toutes vos questions\nconcernant les dernières nouveautés RT 2012 : attestation de prise en\ncompte, contrôle de conformité, etc.\nLe 18 octobre 2012 à la pépinière d''entreprise - Albasud\nIntervenant : M. Philippe Mispouille\ninscription avant le 11/10/2012\n\n ** POUR VOUS INSCRIRE : ** \n\n\n	Envoyez nous un email de confirmation à be3c@be3c.com [1], \nen précisant le point technique auquel vous souhaitez participer.\n\nLinks:\n------\n[1] mailto:be3c@be3c.com\n\n\n\n	Confirmez nous votre présence par téléphone au 05 63 23 21 00\n\n\n	Remplissez le \nformulaire de participation sur notre site internet [1]\n\nLinks:\n------\n[1] http://www.be3c.com/point-technique\n\n\n ** Les autres rendez-vous : ** \n\n * RT 2012 : Régulation et comptage d''énergie \n16 novembre 2012 à la pépinière d''entreprise - Albasud\nIntervenant : Société Delta Dore, M. Gournede, Responsable prescripteur\nSud-Ouest\ninscription avant le 09/11/2012\n\n * Gestion des ponts thermiques structurels\n14 décembre 2012 à la pépinière d''entreprise - Albasud\nIntervenant : Société Terreal\ninscription avant le 07/12/2012\n', 6, 'Bureau d''étude Be3c', 'be3c@be3c.com', '