be3c@be3c.com', NULL, 1, 0, 'erwan.petrus@gmail.com', 'a:1:{s:12:"ContactGroup";N;}', 'be3c@catalyz-emailing.com', 'be3c@catalyz-emailing.com', 'server1.waterproof.fr', 'be3c@catalyz-emailing.com', 'be3c', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '2012-10-12 08:54:17', 1, '2012-10-18 16:00:47');
