(42, 'Changement intervenant', '', 'IMPORTANT : Changement d''intervenant au point technique du 16/11', 3, '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html>\r\n<head>\r\n<title>Untitled document</title>\r\n</head>\r\n<body>\r\n<table bgcolor="#FFFFFF" align="center" cellspacing="0" cellpadding="0" border="0" style="width: 599px;">\r\n<tbody>\r\n<tr valign="top">\r\n<td align="center" bgcolor="#ffffff" colspan="3"><font face="Tahoma, Geneva, sans-serif" style="line-height: 13px; font-size: 10px;" size="2" color="#669933">Si les images ne s''affichent pas correctement, <a style="color: #669933;" href="#VIEW_ONLINE#" onclick="alert(''Lien vers " view_online="" return="" false="" target="_blank">cliquez ici</a><br /> </font> <img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="1" height="10" alt="" border="0" /></td>\r\n</tr>\r\n<tr style="line-height: 0px; font-size: 0px;" valign="top">\r\n<td colspan="3"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/header_1.png" width="599" height="132" alt="" border="0" /></td>\r\n</tr>\r\n<tr valign="top">\r\n<td valign="top" style="line-height: 0px; font-size: 0px;" align="left" width="12"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/header_2_1.jpg" width="12" height="44" alt="" border="0" /></td>\r\n<td align="center" width="578">\r\n<p><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 28px; font-size: 28px;" size="2" color="#336600"><br /></font></p>\r\n<p><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 28px; font-size: 28px;" size="2" color="#336600">Changement d''intervenant<br /></font><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="1" height="20" alt="" border="0" /></p>\r\n<p><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 17px; font-size: 14px;" size="2" color="#224635">Nous vous informons que la soci&eacute;t&eacute; DELTA DORE ne pourra &ecirc;tre pr&eacute;sente pour le point technique pr&eacute;vu le <strong>Vendredi 16 Novembre 2012</strong>.&nbsp;</font></p>\r\n<p><font color="#224635" face="Trebuchet MS, Helvetica, sans-serif"><span style="font-size: 14px; line-height: 17px;">En revanche, la<strong> soci&eacute;t&eacute; SIEMENS</strong> se fera un plaisir de conduire cette r&eacute;union.&nbsp;</span></font></p>\r\n<p><font color="#224635" face="Trebuchet MS, Helvetica, sans-serif"><span style="font-size: 14px; line-height: 17px;">Nous vous attendons donc comme pr&eacute;vu Vendredi 16 Novembre &agrave; 10h, &agrave; la<strong> p&eacute;pini&egrave;re d''entreprise</strong> (Albasud), pour le point technique portant sur la <strong>RT2012 : R&eacute;gulation et comptage d''&eacute;nergie.&nbsp;</strong></span></font></p>\r\n<p></p>\r\n<p><font color="#224635" face="Trebuchet MS, Helvetica, sans-serif"><span style="font-size: 14px; line-height: 17px;"><strong>&nbsp;L''&eacute;quipe BE3C.</strong></span></font></p>\r\n<p><font color="#224635" face="Trebuchet MS, Helvetica, sans-serif"><span style="font-size: 14px; line-height: 17px;"><strong><br /></strong></span></font></p>\r\n<p><font color="#224635" face="Trebuchet MS, Helvetica, sans-serif"><span style="font-size: 14px; line-height: 17px;"><strong>Pour ceux qui ne se sont pas encore inscris, il ne vous reste que 24h, alors profitez-en !&nbsp;</strong></span></font></p>\r\n<p><font color="#224635" face="Trebuchet MS, Helvetica, sans-serif"><span style="font-size: 14px; line-height: 17px;"><strong>Par mail &agrave; <span style="font-size: large;"><a href="mailto:be3c@be3c.com" target="_blank">be3c@be3c.com</a></span></strong></span></font></p>\r\n<p><font color="#224635" face="Trebuchet MS, Helvetica, sans-serif"><span style="font-size: 14px; line-height: 17px;"><strong>Via notre site Internet en remplissant <a href="http://www.be3c.com/point-technique" target="_blank">le formulaire 