="" border="0" /></td>\n					</tr>\n					<tr align="center">\n						<td style="line-height: 0px; font-size: 0px;" width="10"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="10" height="1" alt="" border="0" /></td>\n						<td width="175">\n							<p><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 18px; font-size: 14px;" size="2" color="#666666">Confirmez votre presence par telephone au<br><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 22px; font-size: 18px;" size="2" color="#669933">05 63 23 21 00</font></font></p>\n						</td>\n						<td style="line-height: 0px; font-size: 0px;" width="9"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n\n															<tr style="line-height: 0px; font-size: 0px;" align="center">\n						<td width="10"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="10" height="1" alt="" border="0" /></td>\n						<td width="175">\n							<img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/right_sep.gif" width="175" height="5" alt="" border="0" />\n						</td>\n						<td width="9"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n					<tr align="center">\n						<td style="line-height: 0px; font-size: 0px;" width="10"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="10" height="1" alt="" border="0" /></td>\n						<td width="175">\n							<p><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 18px; font-size: 14px;" size="2" color="#666666">Remplissez le<span style="font-size: x-small;"> <a href="http://be3c.catalyz-emailing.com/campaign/link/key/#EMAIL#-145-1" target="_blank"><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 18px; font-size: 14px;" size="2" color="#666666">formulaire de participation</font></a></span> sur notre site.</font></p>\n						</td>\n						<td style="line-height: 0px; font-size: 0px;" width="9"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n																			</table>\n			</td>\n		</tr>\n	</table>\n\n	<table width="577" bgcolor="#FFFFFF" align="center" cellspacing="0" cellpadding="0" border="0">\n		<tr style="line-height: 0px; font-size: 0px;">\n			<td><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="1" height="25" alt="" border="0" /></td>\n		</tr>\n		<tr valign="top">\n			<td align="center">\n				<font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 12px; font-size: 10px;" size="2" color="#669933">Conform&#233;ment &#224; la loi Informatique et Libert&#233;s du 06/01/1978, vous disposez d''un droit d''acc&#232;s, de rectification et d''opposition aux informations vous concernant qui peut s''exercer par e-mail &#224; <a style="color:#669933;" href="mailto:be3c@be3c.com" target="_blank">be3c@be3c.com</a> ou en cliquant sur ce <a style="color:#669933;" href="#UNSUBSCRIBE#" target="_blank">lien de d&#233;sinscription</a><br />\n				</font>\n			</td>\n		</tr>\n	</table>\n</body>\n</html>', NULL, '\n ** RT 2012 : INSCRIVEZ-VOUS DES MAINTENANT ! ** \nBe3c vous invite à son point technique de la rentrée 2013 : une réunion\nd''information gratuite sur le thème de la RT 2012, d''une durée de 2h,\nsuivi d''un repas. Retrouvez toutes les informations ci-dessous, et\ninscrivez-vous dès maintenant !\n\n * OBLIGATIONS ADMINISTRATIVES DE LA RT 2012 au dépôt du permis de\n * construire\nPOINT TECHNIQUE LE 18 JANVIER 2013 A 10H, ALBASUD : Après la mise en\napplication du 1er Janvier, nous ferons le point sur ce que réclame\neffectivement l''administration, les obligations de contrôles et de\njustificatifs.\nVendredi 18 Janvier 2013 à 10h00, au Cabinet DARGAM, 70 boulevard du\nDanemark, Albasud\ninscription avant