(106, '2nd envoi point technique 18Janv2013', '1 envoie à Furlan en mode test le 29/11/12 pour qu''il le fasse suivre à son maitre d’œuvre. PhM les rencontre le 06/12', 'Seconde date pour le point technique RT 2012 !', 2, '<?xml version="1.0" standalone="yes"?>\n<root><item><title>s:35:"RT 2012 : SECONDE DATE DISPONIBLE !";</title><introduction>s:412:"Apr&#xE8;s le succ&#xE8;s de sa r&#xE9;union sur la RT 2012 et ses obligations administratives, Be3c a fix&#xE9; une seconde date sur le m&#xEA;me th&#xE8;me, pour ceux qui n''ont pas eu la chance d''y participer. &#xD;\n&#xD;\nToujours sur le m&#xEA;me sch&#xE9;ma : une r&#xE9;union d''information gratuite sur le th&#xE8;me de la RT2012, d''une dur&#xE9;e de 2h, suivi d''un repas. &#xD;\n&#xD;\nRetrouvez toutes les informations ci-dessous, et inscrivez-vous d&#xE8;s maintenant ! ";</introduction><main_title>s:42:"OBLIGATIONS ADMINISTRATIVES DE LA RT 2012 ";</main_title><main_picture>s:35:"/uploads/assets/illustrations/2.png";</main_picture><main_content>s:224:"POINT TECHNIQUE, 15 FEVRIER 2013 A 10H, ALBASUD : &#xD;\n&#xD;\nApr&#xE8;s la mise en application du 1er Janvier, nous ferons le point sur ce que r&#xE9;clame effectivement l''administration, les obligations de contr&#xF4;les et de justificatifs. ";</main_content><main_line_1>s:77:"Vendredi 15 F&#xE9;vrier 2013 &#xE0; 10h00, &#xE0; la p&#xE9;pini&#xE8;re d''entreprise, Albasud. ";</main_line_1><main_line_2>s:0:"";</main_line_2><main_line_3>a:3:{s:3:"day";s:2:"12";s:5:"month";s:1:"2";s:4:"year";s:4:"2013";}</main_line_3><inscription_title>s:20:"POUR VOUS INSCRIRE :";</inscription_title><email>s:188:"&lt;p&gt;Envoyez nous un email de confirmation a&lt;br /&gt;&lt;a href="mailto:be3c@be3c.com" target="_blank"&gt;be3c@be3c.com&lt;/a&gt;,&lt;br /&gt;en precisant le point technique auquel vous souhaitez participer.&lt;/p&gt;";</email><phone>s:85:"&lt;p&gt;Confirmez votre presence par telephone au&lt;br /&gt;&lt;strong&gt;05 63 23 21 00&lt;/strong&gt;&lt;/p&gt;";</phone><fax>s:171:"&lt;p&gt;Remplissez le&lt;span style="font-size: x-small;"&gt; &lt;a href="http://www.be3c.com/point-technique" target="_blank"&gt;formulaire de participation&lt;/a&gt;&lt;/span&gt; sur notre site.&lt;/p&gt;";</fax></item></root>\n', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" 		"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="fr" lang="fr">\n<head>\n	<title>#SUBJECT#</title>\n	<meta http-equiv="content-type" content="text/html; charset=utf-8" />\n</head>\n<body alink="#669933" vlink="#669933" link="#669933" bgcolor="#FFFFFF">\n\n\n	<table width="599" bgcolor="#FFFFFF" align="center" cellspacing="0" cellpadding="0" border="0">\n		<tr valign="top">\n			<td align="center" bgcolor="#ffffff" colspan="3">\n				<font face="Tahoma, Geneva, sans-serif" style="line-height: 13px; font-size: 10px;" size="2" color="#669933">Si les images ne s''affichent pas correctement, <a style="color:#669933;" href="#VIEW_ONLINE#" target="_blank">cliquez ici</a><br />\n				</font>\n				<img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="1" height="10" alt="" border="0" />\n			</td>\n		</tr>\n		<tr style="line-height: 0px; font-size: 0px;" valign="top">\n			<td colspan="3">\n				<img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/header_1.png" width="599" height="132" alt="" border="0" />\n			</td>\n		</tr>\n		<tr valign="top">\n			<td valign="top" style="line-height: 0px; font-size: 0px;" align="left" width="12"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/header_2_1.jpg" width="12" height="44" alt="" border="0" /></td>\n			<td align="center" width="578">\n				<font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 28px; font-size: 28px;" size="2" color="#336600">RT 2012 : SECONDE DATE DISPONIBLE !<br /></font><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="1" height="20" alt="" border