RT2012,\nd''une durée de 2h, suivi d''un repas. Retrouvez toutes les informations\nci-dessous, et inscrivez-vous dès maintenant !\n\n * OBLIGATIONS ADMINISTRATIVES DE LA RT 2012 \nPOINT TECHNIQUE, 15 FEVRIER 2013 A 10H, ALBASUD : Après la mise en\napplication du 1er Janvier, nous ferons le point sur ce que réclame\neffectivement l''administration, les obligations de contrôles et de\njustificatifs.\nVendredi 15 Février 2013 à 10h00, à la pépinière d''entreprise,\nAlbasud.\ninscription avant le 12/02/2013\n\n ** POUR VOUS INSCRIRE : ** \n\n\n	Envoyez nous un email de confirmation a\nbe3c@be3c.com [1],\nen precisant le point technique auquel vous souhaitez participer.\n\nLinks:\n------\n[1] mailto:be3c@be3c.com\n\n\n\n	Confirmez votre presence par telephone au\n05 63 23 21 00\n\n\n	Remplissez le formulaire de participation [1] sur notre site.\n\nLinks:\n------\n[1] http://www.be3c.com/point-technique\n\n\nNotice: Undefined index: other_content in /home/sites/catalyz-emailing.com/be3c/plugins/be3c/modules/be3c/templates/_campaign01_text.php on line 24\n', 6, 'BE3C', 'be3c@catalyz-emailing.com', NULL, 1, 0, '', 'a:5:{s:12:"ContactGroup";N;s:12:"FromDatabase";N;s:9:"FromEmail";N;s:12:"CampaignOpen";N;s:15:"CampaignNotOpen";N;}', 'be3c@catalyz-emailing.com', 'be3c@catalyz-emailing.com', 'server1.waterproof.fr', 'be3c@catalyz-emailing.com', 'be3c', 1, 0, '', '', NULL, '', '', NULL, '2013-01-10 15:36:26', 4, '2013-02-06 09:33:25'),
