be3c/images/campaign01/sep.gif" width="10" height="1" alt="" border="0" /></td>\n						<td width="175">\n							<img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/right_sep.gif" width="175" height="5" alt="" border="0" />\n						</td>\n						<td width="9"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n					<tr align="center">\n						<td style="line-height: 0px; font-size: 0px;" width="10"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="10" height="1" alt="" border="0" /></td>\n						<td width="175">\n							<p><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 18px; font-size: 14px;" size="2" color="#666666">Confirmez votre presence par telephone au<br><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 22px; font-size: 18px;" size="2" color="#669933">05 63 23 21 00</font></font></p>\n						</td>\n						<td style="line-height: 0px; font-size: 0px;" width="9"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n\n															<tr style="line-height: 0px; font-size: 0px;" align="center">\n						<td width="10"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="10" height="1" alt="" border="0" /></td>\n						<td width="175">\n							<img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/right_sep.gif" width="175" height="5" alt="" border="0" />\n						</td>\n						<td width="9"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n					<tr align="center">\n						<td style="line-height: 0px; font-size: 0px;" width="10"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="10" height="1" alt="" border="0" /></td>\n						<td width="175">\n							<p><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 18px; font-size: 14px;" size="2" color="#666666">Remplissez le<span style="font-size: x-small;"> <a href="http://be3c.catalyz-emailing.com/campaign/link/key/#EMAIL#-280-1" target="_blank"><font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 18px; font-size: 14px;" size="2" color="#666666">formulaire de participation</font></a></span> sur notre site.</font></p>\n						</td>\n						<td style="line-height: 0px; font-size: 0px;" width="9"><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="9" height="1" alt="" border="0" /></td>\n					</tr>\n																			</table>\n			</td>\n		</tr>\n	</table>\n\n	<table width="577" bgcolor="#FFFFFF" align="center" cellspacing="0" cellpadding="0" border="0">\n		<tr style="line-height: 0px; font-size: 0px;">\n			<td><img src="http://be3c.catalyz-emailing.com/be3c/images/campaign01/sep.gif" width="1" height="25" alt="" border="0" /></td>\n		</tr>\n		<tr valign="top">\n			<td align="center">\n				<font face="Trebuchet MS, Helvetica, sans-serif" style="line-height: 12px; font-size: 10px;" size="2" color="#669933">Conform&#233;ment &#224; la loi Informatique et Libert&#233;s du 06/01/1978, vous disposez d''un droit d''acc&#232;s, de rectification et d''opposition aux informations vous concernant qui peut s''exercer par e-mail &#224; <a style="color:#669933;" href="mailto:be3c@be3c.com" target="_blank">be3c@be3c.com</a> ou en cliquant sur ce <a style="color:#669933;" href="#UNSUBSCRIBE#" target="_blank">lien de d&#233;sinscription</a><br />\n				</font>\n			</td>\n		</tr>\n	</table>\n</body>\n</html>', NULL, '\n ** RT 2012 : SECONDE DATE DISPONIBLE ! ** \nAprès le succès de sa réunion sur la RT 2012 et ses obligations\nadministratives, Be3c a fixé une seconde date sur le même thème, pour\nceux qui n''ont pas pu y participer. Toujours sur le même schéma : une\nréunion d''information gratuite sur le thème de la RT2012, d''une durée de\n2h, suivi d''un repas. Retrouvez toutes les informations ci-dessous, et\ninscrivez-vous dès maintenant !\n\n * OBLIGATIONS ADMINISTRATIVES DE LA RT 2012 \nPOINT TECHNIQUE, 15 FEVRIER 2013 A 10H, ALBASUD : Après la mise en\napplication du 1er Janvier, nous ferons le point sur ce que réclame\neffectivement l''administration, les obligations de contrôles et de\njustificatifs.\nVendredi 15 Février 2013 à 10h00, à la pépinière d''entreprise,\nAlbasud.\ninscription avant le 12/02/2013\n\n ** POUR VOUS INSCRIRE : ** \n\n\n	Envoyez nous un email de confirmation a\nbe3c@be3c.com [1],\nen precisant le point technique auquel vous souhaitez participer.\n\nLinks:\n------\n[1] mailto:be3c@be3c.com\n\n\n\n	Confirmez votre presence par telephone au\n05 63 23 21 00\n\n\n	Remplissez le formulaire de participation [1] sur notre site.\n\nLinks:\n------\n[1] http://www.be3c.com/point-technique\n\n\nNotice: Undefined index: other_content in /home/sites/catalyz-emailing.com/be3c/plugins/be3c/modules/be3c/templates/_campaign01_text.php on line 24\n', 6, 'BE3C', 'be3c@catalyz-emailing.com', NULL, 1, 0, '', 'a:5:{s:12:"ContactGroup";N;s:12:"FromDatabase";N;s:9:"FromEmail";N;s:12:"CampaignOpen";N;s:15:"CampaignNotOpen";N;}', 'be3c@catalyz-emailing.com', 'be3c@catalyz-emailing.com', 'server1.waterproof.fr', 'be3c@catalyz-emailing.com', 'be3c', 1, 0, '', '', NULL, '', '', NULL, '2013-01-25 09:30:52', 4, '2013-02-07 08:59:56');
