(116, 'Point tech Mars 13', '', 'Invitation point technique RTex', 2, '<?xml version="1.0" standalone="yes"?>\n<root><item><title>s:29:"Invitation au point technique";</title><introduction>s:244:"Be3c vous invite &#xE0; son nouveau point technique : une r&#xE9;union d''informations gratuite d''une dur&#xE9;e de 2h, portant sur un th&#xE8;me sp&#xE9;cifique, suivi d''un repas. &#xD;\n&#xD;\nRetrouvez toutes les informations ci-dessous et inscrivez-vous d&#xE8;s maintenant. ";</introduction><main_title>s:42:"La R&#xE9;glementation Thermique de l''existant";</main_title><main_picture>s:40:"/uploads/assets/illustrations/Image1.png";</main_picture><main_content>s:230:"Tous les travaux de r&#xE9;novation sont soumis &#xE0; la R&#xE9;glementation Thermique de l&#x2019;existant (RTex), entr&#xE9;e en vigueur depuis Juin 2008 !&#xD;\n&#xD;\nNous vous invitons &#xE0; notre point technique afin de d&#xE9;couvrir plus en d&#xE9;tail la RTex.&#xD;\n";</main_content><main_line_1>s:71:"Le Vendredi 15 Mars 2013, 10h, &#xE0; la p&#xE9;pini&#xE8;re d''entreprise, Albasud.";</main_line_1><main_line_2>s:46:"M. COTTINEAU, D&#xE9;l&#xE9;gu&#xE9; r&#xE9;gional, PROMOTELEC";</main_line_2><main_line_3>a:3:{s:3:"day";s:2:"11";s:5:"month";s:1:"3";s:4:"year";s:4:"2013";}</main_line_3><inscription_title>s:20:"POUR VOUS INSCRIRE :";</inscription_title><email>s:202:"&lt;p&gt;Envoyez nous un email de confirmation &amp;agrave;&lt;br /&gt;&lt;a href="mailto:be3c@be3c.com" target="_blank"&gt;be3c@be3c.com&lt;/a&gt;,&lt;br /&gt;en pr&amp;eacute;cisant le point technique auquel vous souhaitez participer.&lt;/p&gt;";</email><phone>s:99:"&lt;p&gt;Confirmez votre pr&amp;eacute;sence par t&amp;eacute;lephone au&lt;br /&gt;&lt;strong&gt;05 63 23 21 00&lt;/strong&gt;&lt;/p&gt;";</phone><fax>s:136:"&lt;p&gt;Remplissez le &lt;a href="http://www.be3c.com/point-technique" target="_blank"&gt;formulaire de participation&lt;/a&gt; sur notre site.&amp;nbsp;&lt;/p&gt;";</fax></item></root>\n', '<!DOCTYPE html PUBLIC 