td>\n		</tr>\n	</table>\n</body>\n</html>', NULL, '\n ** Invitation au point technique ** \nBe3c vous invite à son nouveau point technique : une réunion\nd''informations gratuite d''une durée de 2h, portant sur un thème\nspécifique, suivi d''un repas. Retrouvez toutes les informations ci-dessous\net inscrivez-vous dès maintenant.\n\n * La Réglementation Thermique de l''existant\nTous les travaux de rénovation sont soumis à la Réglementation Thermique\nde l’existant (RTex), entrée en vigueur depuis Juin 2008 ! Nous vous\ninvitons à notre point technique afin de découvrir plus en détail la\nRTex.\nLe Vendredi 15 Mars 2013, 10h, à la pépinière d''entreprise, Albasud.\nIntervenant : M. COTTINEAU, Délégué régional, PROMOTELEC\ninscription avant le 11/03/2013\n\n ** POUR VOUS INSCRIRE : ** \n\n\n	Envoyez nous un email de confirmation à\nbe3c@be3c.com [1],\nen précisant le point technique auquel vous souhaitez participer.\n\nLinks:\n------\n[1] mailto:be3c@be3c.com\n\n\n\n	Confirmez votre présence par télephone au\n05 63 23 21 00\n\n\n	Remplissez le formulaire de participation [1] sur notre site. \n\nLinks:\n------\n[1] http://www.be3c.com/point-technique\n\n\nNotice: Undefined index: other_content in /home/sites/catalyz-emailing.com/be3c/plugins/be3c/modules/be3c/templates/_campaign01_text.php on line 24\n', 6, 'BE3C', 'be3c@catalyz-emailing.com', '2013-02-28 08:15:00', 2, 0, 'daniel.nederovique@be3c.com\r\ngregory.barthe@be3c.com', NULL, 'be3c@catalyz-emailing.com', 'be3c@catalyz-emailing.com', 'server1.waterproof.fr', 'be3c@catalyz-emailing.com', 'be3c', 1, 0, '', '', NULL, '', '', NULL, '2013-02-20 15:56:57', 4, '2013-03-07 16:50:39'),
